import Featured from '../components/Featured';

export default function FeaturedContent(props) {
  return (
    <div className="fc-wrapper">
      <div className="fc">
        <div className="item">
        </div>
        <div className="item">
        </div>
        <div className="item">
        </div>
        <div className="item">
        </div>
        <div className="item">
        </div>
        <div className="item">
        </div>
      </div>
    <style jsx>{`
        .fc-wrapper {
          height: 80vh;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .fc {
          width: 75%;
          height: 75%;
          background: black;
          display: flex;
          flex-flow: row wrap;
          justify-content: space-around;
        }

        .item {
          height: 120px;
          width: 240px;
          background: white;
          margin-left: 10px;
          box-shadow: 0px 3px 6px rgba(0, 0, 0, 0.25);
          border-radius: 5px;
        }
      `}</style>
    </div>
  )
}
